  /**
   * Xử lý sự kiện sau khi thanh toan bill hoặc xóa bill. Sẽ xoá khỏi listBills và nếu listBills rỗng sẽ tạo bill mới
   * @param id_bill id của bill cần thanh toán hoặc xóa
   * @example this.handleSaveBill('GBDUWYGQLHODIUEWDWQF');
   */


  handleSaveBill(id_bill) {
    const index = this.listBills.findIndex(item => item._id == id_bill);
    this.listBills.splice(this.listBills.findIndex(item => item._id == id_bill), 1);

    if (!this.listBills.length) {
      this.newBill();
    } else {
      // Nếu xoá bill trước bill đang chọn thì giảm index, bill đang chọn thì vẫn giữu nguyên nên không cần selectBill lại
      if (index < this.selectedIndex) {
        this.selectedIndex--;
      } // Nếu xoá bill đang chọn
      else if (index == this.selectedIndex) {
        // Nếu là bill cuối thì update lại index là length - 1
        if (index >= this.listBills.length - 1) {
          this.selectedIndex = this.listBills.length - 1;
        } // Nếu không phải bill cuối thì vẫn giữ nguyên index
        else {
          this.selectedIndex = index;
        }

        this.selectBill(this.listBills[this.selectedIndex], this.selectedIndex);
      }
    }
  }
